import React from "react";

const Home = () => {
   return (
      <div>
         <section>
            <div className="App App-content">
               <h1>The Future of Bid Scoping</h1>
               <p>Find Out More</p>
            </div>
         </section>
         <section>
            <div className="App section">
               <div>
                  <h3>What is Bidscope</h3>
               </div>
            </div>
         </section>
      </div>
   );
};

export default Home;
